(1, 'Nokia N1 Android tablet vs iPad mini 3: A specs faceoff', 'Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.Nokia has made a surprise comeback into the world of consumer tech devices with the launch of its new Android tablet, the Nokia N1.', 19, 0, 'qxhoxod3hyqf6mx5c8xikjaodxunzpy934ukzvttllp6lmetz1.jpeg', '2014-11-19 00:00:00', NULL),
(2, 'Specs, Processor and Connectivity ', ' The Nokia N1 comes with a 64-bit Intel Atom Z3580 processor clocked at 2.3GHz and coupled with 2GB of RAM. It also includes PowerVR G6430 GPU. The N1 offers 32GB onboard storage, but there is no microSD card slot to expand it further. The connectivity options include dual channel 802.11a/b/g/n/ac Wi-Fi with MIMO, microUSB 2.0 and Bluetooth 4.0.', 19, 0, 'qxhoxod3hyqf6mx5c8xikjaodxunzpy934ukzvttllp6lmetz1.jpeg', '2014-11-19 00:00:00', NULL),
